import './App.css';

// class based componant by rcc directly
import React, { Component } from 'react'
import Navbar from './Componant/Navbar';
import NewsCom from './Componant/NewsCom';
import {

  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

export default class App extends Component {
  //IMP LINE ::: -->> In Class based componant we can define js uppar from the render function and can access props variables and function 
  // by using the (this.var) keyword
    render() {
    return (
      <div>
        <div>
            <Navbar/>
            {/* int ka liya {} or string ka liya comma */}
            {/* <NewsCom pageSize={15} country="in" category="sports"/> */}
        </div>

        <BrowserRouter>
            <Routes>
                <Route path='/general' element={<NewsCom pageSize={15} country="in" category="general"/>}/>
                <Route path='/entertainment' element={<NewsCom pageSize={15} country="in" category="entertainment"/>}/>
                <Route path='/business' element={<NewsCom pageSize={15} country="in" category="business"/>}/>
                <Route path='/health' element={<NewsCom pageSize={15} country="in" category="health"/>}/>
                <Route path='/sports' element={<NewsCom pageSize={15} country="in" category="sports"/>}/>
                <Route path='/science' element={<NewsCom pageSize={15} country="in" category="science"/>}/>
                <Route path='/technology' element={<NewsCom pageSize={15} country="in" category="technology"/>}/>


            </Routes> 
      </BrowserRouter>
      </div>
    )
  }
}
